import React from "react";
import "../style.css";

interface listProps {
    id: number;
    description: string;
}

interface TodoListProps {
    list: listProps[];
}

const TodoList: React.FC<TodoListProps> = ({list}) => {
    return (
        <div> 
            <div>
                {list[1].description}
            </div>
        </div>
    )
};




export default TodoList;
